  false,\n\t\"url\": null,\n\t\"notes\": \"A survey of the breeding peregrine falcon
  (Falco peregrinus) population was made on Amchitka Island, Alaska, during the 1980
  summer field season. The survey was completed at the same time data was being collected
  on the breeding bald eagle (Haliaeetus leucocephalus) population on the island.
  The purpose of the raptor survey was to locate and map eyries and to collect information
  on nest productivity. The following is a summary of those data as compared to information
  collected by White et. al. (1977).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
